   "source": [
    "tan = tree.bayes(dt_both, 'ClaimCountClassification')\n",
    "tan\n",
    "\n",
    "\n",
    "options(repr.plot.width=10, repr.plot.height=10)\n",
    "g <- Rgraphviz::layoutGraph(bnlearn::as.graphNEL(cextend(tan)), layoutType='dot')\n",
    "graph::nodeRenderInfo(g) <- list(fontsize=38, lwd=2, fill='#C9CEBD', textCol='#1D1C1A')\n",
    "graph::edgeRenderInfo(g) <- list(lwd=1, arrowhead='open', arrowtail='none')\n",
    "Rgraphviz::renderGraph(g)    \n",
    "\n",
    "fitted = bn.fit(cextend(tan), dt_both, method = \"bayes\")\n",
    "\n",
    "pred_train_hc = predict(fitted, data_train, prob=TRUE, node='ClaimCountClassification')\n",
    "true_train_hc = data_train[, 'ClaimCountClassification']\n",
    "\n",
    "pred_test_hc = predict(fitted, data_test, prob=TRUE, node='ClaimCountClassification')\n",
    "true_test_hc = data_test[, 'ClaimCountClassification']\n",
    "\n",
    "precision <- posPredValue(pred_test_hc, true_test_hc, positive=\"1\")\n",
    "recall <- sensitivity(pred_test_hc, true_test_hc, positive=\"1\")\n",
    "\n",
    "precision\n",
    "recall\n",
    "\n",
    "caret::confusionMatrix(pred_test_hc, true_test_hc, positive='1')\n",
    "F1_Score(pred_test_hc, true_test_hc, positive='1')"
   ]
  },
